xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:8;a:5:{s:4:\"data\";s:13:\"Happiness Bar\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:9;a:5:{s:4:\"data\";s:11:\"Nova Scotia\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:10;a:5:{s:4:\"data\";s:5:\"tours\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:11;a:5:{s:4:\"data\";s:8:\"WordCamp\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:12;a:5:{s:4:\"data\";s:16:\"WordCamp Halifax\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"https://en-ca.wordpress.org/?p=409\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:320:\"This May marks a very special month for people in Atlantic Canada. Not only will the first signs of spring appear in the area (finally), but a new conference will be popping up as well. WordCamp Halifax is happening on May 27th at Marion McCain Building at Dalhousie University. This will be the first WordCamp [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"Alison Knott\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:3670:\"<figure id=\"attachment_412\" aria-describedby=\"caption-attachment-412\" style=\"width: 290px\" class=\"wp-caption alignright\"><img class=\"wp-image-412 size-medium\" src=\"https://en-ca.wordpress.org/files/2017/04/Large_lobster_wapuu-290x300.jpg\" alt=\"offical wapuu of WordCamp Halifax\" width=\"290\" height=\"300\" srcset=\"https://en-ca.wordpress.org/files/2017/04/Large_lobster_wapuu-290x300.jpg 290w, https://en-ca.wordpress.org/files/2017/04/Large_lobster_wapuu.jpg 400w\" sizes=\"(max-width: 290px) 100vw, 290px\" /><figcaption id=\"caption-attachment-412\" class=\"wp-caption-text\">Meet &#8216;Wabster&#8217;, WordCamp Halifax&#8217;s official wapuu!</figcaption></figure>\n<p>This May marks a very special month for people in Atlantic Canada. Not only will the first signs of spring appear in the area (finally), but a new conference will be popping up as well.</p>\n<p><a href=\"https://2017.halifax.wordcamp.org/\" target=\"_blank\" rel=\"noopener noreferrer\">WordCamp Halifax</a> is happening on May 27th at Marion McCain Building at Dalhousie University. This will be the first WordCamp in Canada East of Montreal, making it <em>the</em> web-related event of the season for Maritimers.</p>\n<p>&nbsp;</p>\n<h2>Get To Know Halifax</h2>\n<p>Halifax is best known for its friendly community and beautiful harbour. Take in cafes, beer gardens, the Citadel Hill, a farmers market and more pubs than you can count! May is a lovely time of year on the peninsula with lots of sunshine and occasional shower. Be sure to check out the newly built Central Library downtown &#8211; a spectacular architectural feat. Spend the whole week in Halifax to take road trips to other beautiful parts of the province: wine tours, U-picks and quaint fishing villages can all be found within a few hours drive away from the capital.</p>\n<p>WordCamp has affordable accommodations if you want to stay close to the venue. More information can be <a href=\"https://2017.halifax.wordcamp.org/venue/\" target=\"_blank\" rel=\"noopener noreferrer\">found here</a>.</p>\n<p>&nbsp;</p>\n<h2>What To Expect At WordCamp Halifax</h2>\n<p>With a mere $25 price tag, attendees can expect to enjoy:</p>\n<ul>\n<li>Catered lunch</li>\n<li>Swag bag with lots of goodies</li>\n<li>Happiness Bar where attendees can get one-on-one help with their website</li>\n<li>Lots of networking with people from a multitude of industries and skill levels</li>\n<li>25 local, national and international <a href=\"https://2017.halifax.wordcamp.org/speakers/\" target=\"_blank\" rel=\"noopener noreferrer\">speakers</a></li>\n<li>21 <a href=\"https://2017.halifax.wordcamp.org/sessions/\" target=\"_blank\" rel=\"noopener noreferrer\">informative sessions</a> in three tracks</li>\n<li>An After Party five minutes from the venue, with affordable bevvy&#8217;s &amp; snacks (you know how Haligonians love a good kitchen party!)</li>\n</ul>\n<p>The team has worked hard to bring diverse programming to this inaugural WordCamp with three tracks of learning:</p>\n<ul>\n<li><strong>Content Creators:</strong> Easiest sessions. Little prior WordPress experience expected</li>\n<li><strong>Site Creators:</strong> Some WordPress experience would be beneficial for these sessions, but is not required. Small amounts of HTML, CSS, PHP and Javascript might be presented in some talks</li>\n<li><strong>Code Creators:</strong> Advanced WordPress concepts, HTML, CSS, PHP and Javascript will be presented.</li>\n</ul>\n<p>&nbsp;</p>\n<p>We can&#8217;t wait to see everyone this May, so <a href=\"https://2017.halifax.wordcamp.org/tickets/\" target=\"_blank\" rel=\"noopener noreferrer\">nab a ticket</a>. With a limited seating of 185, you&#8217;ll have to grab one before they&#8217;re gone!</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:83:\"https://en-ca.wordpress.org/2017/04/18/wordcamp-coming-to-halifax-nova-scotia/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\"