0;a:5:{s:4:\"data\";s:396:\"The core WordPress project, have now opened up supported themes for translation into local languages. This has opened up thousands of new text strings to translate from US English to Canadian English. If you would like to assist, then you can head on over to https://translate.wordpress.org/locale/en-ca/default/wp-themes and start translating. We will then review all submitted stings [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:23:\"Charles E. Frees-Melvin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:574:\"<p>The core WordPress project, have now opened up supported themes for translation into local languages. This has opened up thousands of new text strings to translate from US English to Canadian English.</p>\n<p>If you would like to assist, then you can head on over to <a href=\"https://translate.wordpress.org/locale/en-ca/default/wp-themes\">https://translate.wordpress.org/locale/en-ca/default/wp-themes</a> and start translating.</p>\n<p>We will then review all submitted stings for accuracy. You can post a comment to this post of the themes you have contributed to.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:60:\"https://en-ca.wordpress.org/2015/07/20/themes-in-en-ca/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xm