(2850, 'backwpup_message_content_en', 'Are you happy with BackWPup? If you are satisfied with our free plugin and support, then please make us even happier and just take 30 seconds to leave a positive rating. :) We would really appreciate that and it will motivate our team to develop even more cool features for BackWPup!', 'no'),
(2851, 'backwpup_message_button_text_en', 'Make Us Happy and Give Your Rating', 'no'),
(2852, 'backwpup_message_url_en', 'https://wordpress.org/support/plugin/backwpup/reviews/', 'no'),
(2853, 'backwpup_message_id_es', 'YKQUQYL2NZXXGIDGMVWGSY3FOMQHSIDEMFXG64ZAOR2SA5TBNRXXEYLDNHB3G3RBPRUHI5DQOM5C6L3XN5ZGI4DSMVZXGLTPOJTS643VOBYG64TUF5YGY5LHNFXC6YTBMNVXO4DVOAXXEZLWNFSXO4ZP', 'no'),
(2854, 'backwpup_message_content_es', '¿Estás contento con BackWPup? Si estás satisfecho con nuestro plugin y con el soporte gratuito, por favor, haznos aún más felices e invierte sólo 30 segundos en dejar una calificación positiva. :) ¡Estaremos muy agradecidos y eso motivará a nuestro equipo a desarrollar características aún más interesantes para BackWPup!', 'no'),
(2855, 'backwpup_message_button_text_es', '¡Haznos felices y danos tu valoración!', 'no'),
(2856, 'backwpup_message_url_es', 'https://wordpress.org/support/plugin/backwpup/reviews/', 'no'),
(2857, 'backwpup_message_id_fr', 'IRXW43TFFVXG65LTEB2W4ZJANZXXIZJAOBXXG2LUNF3GK7DIOR2HA4Z2F4XXO33SMRYHEZLTOMXG64THF5ZXK4DQN5ZHIL3QNR2WO2LOF5RGCY3LO5YHK4BPOJSXM2LFO5ZS67D4', 'no'),
(2858, 'backwpup_message_content_fr', 'Êtes-vous satisfait de BackWPup ? Si vous êtes satisfait de notre extension gratuite et du support, alors veuillez nous faire plaisir et prendre seulement 30 secondes pour laisser une note positive. :) Nous apprécions vraiment cela et ceci motivera notre équipe à développer des fonctionnalités en plus cool pour BackWPup!', 'no'),
(2859, 'backwpup_message_button_text_fr', 'Donne-nous une note positive', 'no'),
(2860, 'backwpup_message_url_fr', 'https://wordpress.org/support/plugin/backwpup/reviews/', 'no'),
(2861, 'backwpup_message_id_de', 'JVQWG2BAOVXHGIDHNTB3YY3LNRUWG2BAOVXGIIDHNFRCA5LOOMQGIZLJNZSSAQTFO5SXE5DVNZTXY2DUORYHGORPF53W64TEOBZGK43TFZXXEZZPON2XA4DPOJ2C64DMOVTWS3RPMJQWG23XOB2XAL3SMV3GSZLXOMXXY7D4', 'no'),
(2862, 'backwpup_message_content_de', 'Bist du glücklich mit BackWPup? Wenn du mit unserem freien Plugin und unserem Support zufrieden bist, dann mach auch uns glücklich und gib uns 30 Sekunden deiner Zeit, um uns eine gute Bewertung zu hinterlassen. :) Wir würden uns wirklich sehr darüber freuen, es würde uns motivieren, noch coolere Features für BackWPup zu entwickeln!', 'no'),
(2863, 'backwpup_message_button_text_de', 'Mach uns glücklich und gib uns deine Bewertung', 'no'),
(2864, 'backwpup_message_url_de', 'https://wordpress.org/support/plugin/backwpup/reviews/', 'no'),
(2865, 'backwpup_message_id_it', 'I5ZGC6TJMUWCA3DBONRWSYJANFWCA5DVN4QGMZLFMRRGCY3LPRUHI5DQOM5C6L3XN5ZGI4DSMVZXGLTPOJTS643VOBYG64TUF5YGY5LHNFXC6YTBMNVXO4DVOAXXEZLWNFSXO4ZP', 'no'),
(2866, 'backwpup_message_content_it', 'Ti piace BackWPup? Se sei soddisfatto della versione free e del supporto? Ci piacerebbe se potessi dedicarci 30 secondi e lasciare un feedback positivo. :) Lo apprezzerremo tanto ed inoltre motiverà il team a sviluppare nuove funzionalità per BackWPup!', 'no'),
(2867, 'backwpup_message_button_text_it', 'Grazie, lascia il tuo feedback', 'no'),
(2868, 'backwpup_message_url_it', 'https://wordpress.org/support/plugin/backwpup/reviews/', 'no'),
